import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  height: 2088px;
  width: 993px;
  margin: 0 auto;
  padding-top: 238px;
  box-sizing: border-box;
  & > .top {
    display: flex;
    justify-content: space-between;
    align-items: flex-end;
    & > .left {
      display: flex;
      flex-direction: column;
      & > .logo {
        background-image: url("/assets/steach.svg");
        background-position: center;
        background-repeat: no-repeat;
        background-size: cover;
        width: 113px;
        height: 44.1px;
        display: flex;
        justify-content: center;
        align-items: center;
        font-size: 16px;
        font-weight: bold;
        color: #434343;
      }
      & > .title {
        margin-top: 26px;
        font-size: 37px;
        font-weight: bold;
        line-height: 1.43;
      }
      & > .sub {
        margin-top: 16px;
        font-size: 17px;
        line-height: 1.59;
      }
    }
    & > .right {
      width: 414px;
      height: 181px;
      border-radius: 10px;
      background-color: #47d99b;
      display: flex;
      align-items: center;
      box-sizing: border-box;
      padding-left: 22px;
      & > figure {
        width: 134px;
        height: 133px;
        background-color: white;
        border-radius: 134px;
        display: flex;
        justify-content: center;
        align-items: center;
        & > img {
          width: 84.3px;
          height: 81.8px;
        }
      }
    }
  }
`;
function Section4() {
  return (
    <Wrapper>
      <div className="top">
        <div className="left">
          <div className="logo">고객문의</div>
          <span className="title">
            궁금하신 게 있으면 언제든지
            <br /> 김과장 컨설팅을 찾아주세요
          </span>
          <span className="sub">
            기업지원이 필요하고 고민중이시라면 김과장에게 편하게 문의주세요.
            <br />
            최대한 빠르게, 그리고 친절하게 답변 드리겠습니다.
          </span>
        </div>
        <div className="right">
          <figure>
            <img src="/assets/kimface.svg" alt="" />
          </figure>
          <div className="info">
            <div>010-9700-2594</div>
            <div>Help@kcons.kr</div>
            <div>카카오톡 채널 kcons</div>
          </div>
        </div>
      </div>
    </Wrapper>
  );
}

export default Section4;
